import React, { useEffect } from "react";

import { Meta } from "../layout/Meta";
import { Main } from "../templates/Main";
import { Line } from "react-chartjs-2";
import { options, data, scenarioOne } from "../utils/chartInfo";

const Index = () => {
  const applyOne = () => {
    data.datasets.push(scenarioOne);
  };

  useEffect(() => {
    // only add user preferences if the user has logged in
    window.location.reload();
  }, [data.datasets]);

  return (
    <Main
      meta={
        <Meta
          title="Cannon Demonstrative"
          description="The demonstrative for Dr. Robert Cannon - Gardner Consulting."
        />
      }
    >
      <div className="m-20">
        <Line data={data} options={options}></Line>
        <button onClick={() => applyOne()}>Click me</button>
      </div>
      <div></div>
    </Main>
  );
};

export default Index;
